import React from "react";

export const Messages = ({messages}) => {
    return(
        <div className='message bg-light my-3 w-25'>
            <p className='text-primary mx-2 my-2'>{messages.user}</p>
            <div className='h-50'>
                {messages.title}
            </div>
           {messages.date}
        </div>
    )
}
